import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SpotifysignupComponent } from './spotifysignup/spotifysignup.component';
import { SpotifyloginComponent } from './spotifylogin/spotifylogin.component';
import { RouterModule, Routes } from '@angular/router';


const routes: Routes = [
  {
    path:"",
    component:SpotifysignupComponent
  },
  {
    path:"login",
    component:SpotifyloginComponent
  }
];
@NgModule({
  declarations: [
    SpotifysignupComponent,
    SpotifyloginComponent
  ],
  imports: [
    RouterModule.forRoot(routes),
    CommonModule
  ],
  exports:[
    RouterModule
  ]
})
export class ReactiveformsModule { }
